export default class index extends React.Component {

    static async getInitialProps() {
        return {}
    }

    render() {
        return (
            <div>
                <h1 className='title'>Molly Percocet</h1>

                <style global jsx>
                    {`
                        body {
                        background: coral;
                        },
                        .title{
                            color: blue;
                        }
                    `}
                </style>

            </div>
        )

    }



}
